import React, { useEffect } from 'react'
import { useParams } from 'react-router-dom';
import axios from 'axios';

export default function EditBlog() {

    const { id } = useParams();

    const fetchBlog = () => {
        fetch('http://localhost:1337/api/blogs/'+id,{
            method : 'GET'
        })
        .then(response => response.json())
        .then((res) => {
            console.log(res);
        })
        .catch((error) => {
            console.log(error);
        });
    }

    useEffect(() => {
        fetchBlog();
    }, [])

    return (
        <div>EditBlog</div>
    )
}
